import React from 'react';
import BookTable from './components/BookTable';
import UserImput from './components/UserInput';
import MainHeader from './components/MainHeader';

function App() {
  return (
    <div className="App">
      <div className="container">
        <MainHeader />
        <div>
          <UserImput />
          <BookTable />
        </div>
      </div>
    </div>
  );
}

export default App;
